PRAGMA synchronous = OFF;
PRAGMA journal_mode = MEMORY;
BEGIN TRANSACTION;
DROP TABLE IF EXISTS `activationCodes`;
CREATE TABLE `activationCodes` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `token` varchar(255) NOT NULL
,  `used` integer NOT NULL DEFAULT '0'
,  UNIQUE (`token`)
);
DROP TABLE IF EXISTS `globalSearches`;
CREATE TABLE `globalSearches` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `lastChecked` datetime NOT NULL
,  `uid` varchar(255) NOT NULL
);
DROP TABLE IF EXISTS `passwordReset`;
CREATE TABLE `passwordReset` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `user` integer NOT NULL
,  `token` varchar(255) NOT NULL
,  `expire` timestamp NOT NULL 
,  `used` integer NOT NULL DEFAULT '0'
,  UNIQUE (`token`)
);
DROP TABLE IF EXISTS `payments`;
CREATE TABLE `payments` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `userId` integer NOT NULL
,  `amount` decimal(10,2) NOT NULL DEFAULT '0.00'
,  `subscription` text  NOT NULL
,  `date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00'
,  `expires` datetime NOT NULL DEFAULT '0000-00-00 00:00:00'
,  `transId` mediumtext NOT NULL
,  `cardType` varchar(255) NOT NULL
,  `last4` varchar(4) NOT NULL
,  `discountCode` integer NOT NULL
,  `discount` decimal(10,2) NOT NULL
,  `failureCode` varchar(255) DEFAULT NULL
,  `failureMess` mediumtext COLLATE utf8_unicode_ci
);
DROP TABLE IF EXISTS `restaurants`;
CREATE TABLE `restaurants` (
  `id` varchar(255) NOT NULL
,  `name` varchar(255) NOT NULL
,  PRIMARY KEY (`id`)
);
');
DROP TABLE IF EXISTS `searchLogs`;
CREATE TABLE `searchLogs` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `uid` varchar(255) NOT NULL
,  `dateSearched` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
,  `message` varchar(255) NOT NULL
,  `foundSeats` integer NOT NULL DEFAULT '0'
,  `times` mediumtext NOT NULL
);
DROP TABLE IF EXISTS `smsGateways`;
CREATE TABLE `smsGateways` (
  `id` varchar(100) NOT NULL
,  `country` varchar(255) NOT NULL
,  `name` varchar(255) NOT NULL
,  `gateway` varchar(255) NOT NULL
,  PRIMARY KEY (`id`)
);
DROP TABLE IF EXISTS `userSearches`;
CREATE TABLE `userSearches` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `restaurant` varchar(255) NOT NULL
,  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
,  `date` datetime NOT NULL
,  `partySize` integer NOT NULL
,  `uid` varchar(255) NOT NULL
,  `user` varchar(255) NOT NULL
,  `enabled` integer NOT NULL DEFAULT '1'
,  `deleted` integer NOT NULL DEFAULT '0'
,  `lastEmailNotification` datetime NOT NULL DEFAULT '1970-01-01 00:00:00'
,  `lastSMSNotification` datetime NOT NULL DEFAULT '1970-01-01 00:00:00'
);
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `created` datetime NOT NULL
,  `email` varchar(255) NOT NULL
,  `password` varchar(255) NOT NULL
,  `firstName` varchar(255) NOT NULL
,  `lastName` varchar(255) NOT NULL
,  `zipCode` varchar(15) NOT NULL
,  `phone` varchar(25) NOT NULL
,  `carrier` varchar(100) NOT NULL
,  `sendTxt` integer NOT NULL DEFAULT '0'
,  `sendEmail` integer NOT NULL DEFAULT '1'
,  `emailTimeout` integer NOT NULL DEFAULT '14400'
,  `smsTimeout` integer NOT NULL DEFAULT '14400'
,  `activated` integer DEFAULT '0'
,  `admin` integer NOT NULL DEFAULT '0'
,  `subExpires` datetime NOT NULL DEFAULT '1970-01-01 00:00:00'
,  `eula` datetime NOT NULL DEFAULT '1970-01-01 00:00:00'
,  UNIQUE (`email`)
);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`userId`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`uid`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`dateSearched`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`lastName`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`carrier`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`sendTxt`);
CREATE INDEX "REATE TABLE _ KEY " ON "REATE TABLE " (`sendEmail`);
END TRANSACTION;
